СПЕЦИФИКАЦИЯ

7 шарикоподшипников;

1 роликовый подшипник;

Мгновенный стопор обратного хода;

Полая дужка лескоукладывателя;

Antitwist Roller - противозакручиватель лески;

Компьютерная балансировка ротора;

Алюминиевая рукоятка;

Запасная графитовая шпуля.

Заходите к нам в гости в рыболовный магазин *Три Судака* по адресу Сморговский тракт 9. Работаем без выходных.

#трисудака #3sudakaby #3sudaka #blackside #fishing #spinning #spinningteam #ecogroup #рыбалка #снасти #катушка #рыболовный #рыболовныймагазин #рыболов #новинка #new #2020 #рыбак #рыболовныетовары  #рыбалкавбеларуси #aviator

Мультипликаторная, инерционная катушка с фрикционным тормозом и шпулей открытого типа.Передаточное число:3.6:1. Надежная конструкция из морозоустойчивого пластика и алюминия позволяет использовать катушку в самые суровые морозы. Четыре высококачественных шарикоподшипника из нержавеющей стали обеспечивают плавную работу. Тормоз регулируется вращением «звездочки» и позволяет использовать лески с различными разрывными нагрузками. Система быстрого сброса лески включатся кнопкой расположенной в ручке и помогает быстро заглубить приманку на необходимую глубину. Так же катушка снабжена: антиреверсом, системой подтормаживания шпули и трещеткой. Область применения не ограничивается только зимой. Летом катушку можно использовать на болонской удочке при ловле в проводку и при отвесной ловле с лодки.

СПЕЦИФИКАЦИЯ:
• Под левую руку
• 4 шарикоподшипника;
• 1 роликовый подшипник;
• Передаточное число:3.6:1;
• Морозоустойчивый пластик корпуса и шпули;
• Система быстрого сброса лески(свободный ход шпули);
• Мгновенный стопор обратного хода;
• Система подтормаживания шпули;
• Трещетка.

Заходите к нам в гости, в рыболовный магазин *Три Судака*. Работаем без выходных.

